import React, { Component } from 'react';
import { Container, Row, Col } from 'react-bootstrap';
import { GetGameList } from '../../actions/'
import '../../scss/browse_page/browse_page.scss';

export default class BrowsePage extends Component {
  constructor() {
    super();
    this.state = {};
  }

  render() {
    return (
      <Container className="w-100 py-5" id="browse-container">
        <Row>
          <Col>
            <p>Sort By: Release Date</p>
          </Col>
          <Col xs={2}>
            <p>Categories</p>
            <p>---</p>
            <p>Action</p>
            <p>Adventure</p>
          </Col>
        </Row>
      </Container>
    );
  }
}
